import React from 'react';
import './Experience.css';

function Experience() {
  return (
    <>
      <div
        className='experience-containter'
        data-aos='fade-up'
        data-aos-offset='600'
        data-aos-duration='1500'
      >
        <h1 className='experience-heading'>
          She is uniquely experienced to <br />
          lead projects at the intersection <br />
          of social impact, culture, digital <br />
          media, and policy.
        </h1>
      </div>
    </>
  );
}

export default Experience;
